    GetRecipeById: AuthMiddleware.Authorize(RecipeController.getRecipeById),
    CreateRecipe: AuthMiddleware.Authorize(RecipeController.createRecipe),

    createArticle: async args => {
        try {
            console.log("thing")
        } catch (error) {
            throw error
        }
    },
}

